INSERT INTO `channels` VALUES (5,'BITCOIN-NINJA5c46c5f8ce5e0',7,'BITCOIN NINJA','<p><br />\r\nDrawing of the archetypical ninja from a series of sketches (Hokusai Manga) by Hokusai. Woodblock print on paper. Volume six, 1817.<br />\r\nA ninja (忍者) or shinobi (忍び) was a covert agent or mercenary in feudal Japan. The functions of a ninja included espionage, sabotage, infiltration, assassination and guerrilla warfare.[1] Their covert methods of waging irregular warfare were deemed dishonorable and beneath the honor of the samurai.[2] Though shinobi proper, as specially trained spies and mercenaries, appeared in the 15th century during the Sengoku period (15th&ndash;17th centuries),[3] antecedents may have existed as early as the 12th century.[4][5]</p>\r\n\r\n<p>&nbsp;</p>\r\n','http://159.65.228.72/uploads/channels/picture/1b6b1abfbc96242252c5d670bfba33ac474f5552.JPG','http://159.65.228.72/uploads/channels/cover/9731eff497ce03bf9b7183723842c0d109e10aa6.jpg',1,1,'2019-01-22 07:27:52','2019-01-22 07:27:52',1),(7,'Bossiquit5c4748730e116',10,'Bossiquit','<p>Hey Ladies and Gents, Are You ready to truly Fire Your boss. Well This channel is created for people looking to Win In Business and life!&nbsp;</p>\r\n','https://www.cjclive.com/uploads/channels/picture/ad0c526c15383f87128836ce576ce5b8a8d32e6d.jpg','https://www.cjclive.com/uploads/channels/cover/e44bd5c8534cced3e209a7e930bc373ec8556ac6.jpg',1,1,'2019-01-22 16:44:35','2019-01-22 16:44:35',1),(8,'CJCLIVE-PAY-PER-VIEW-5c6cb66383742',11,'CJCLIVE PAY PER VIEW ','<p>UPLOAD GET PAID&nbsp;</p>\r\n\r\n<p>INVITE GET PAID&nbsp;</p>\r\n\r\n<p>GO SOCIAL GET PAID</p>\r\n\r\n<p>EARN DAILY&nbsp;</p>\r\n\r\n<p>EARN MONTHLY</p>\r\n\r\n<p>BE A CONTENT CREATOR</p>\r\n','https://www.cjclive.com/uploads/channels/picture/0e980de1854a0843bbcafa7afac3dfdbc8e2af03.jpg','https://www.cjclive.com/uploads/channels/cover/2ef3ba316a0109db57524c0f2062e0434e14b781.jpeg',1,1,'2019-01-22 17:27:02','2019-02-20 02:07:31',1),(9,'FoodWithE&K5c47bbd91704d',14,'FoodWithE&K','<p>Come enjoy our easy cooking, kid-friendly recipes as we venture into the taste of different worlds.&nbsp;</p>\r\n','https://cjclive.com/uploads/channels/picture/44f1c94fc3e47692d1e99c53ea6263a2d4382b22.png','https://cjclive.com/uploads/channels/cover/ec22d1e2401c71672018a3f5009f8058e317017a.jpg',1,1,'2019-01-23 00:56:18','2019-01-23 00:56:57',1),(10,'The-Rosario-Family-Journal5c4800e934822',15,'The Rosario Family Journal','<p>Meet Jake, Maricel, and Baby Mira. Come along for the ride as we&nbsp;show you all the amazing&nbsp;places of Hawaii and beyond.&nbsp;Welcome to our family adventure!&nbsp;</p>\r\n','https://www.cjclive.com/uploads/channels/picture/4c2a705b5705d349dd6b78fe97dcc9d72b5ab6f0.jpg','https://www.cjclive.com/uploads/channels/cover/a512f9be5a9859e914cc15dca329f0f4ff91a4b8.jpg',1,1,'2019-01-23 00:59:59','2019-01-23 05:51:37',1),(11,'Live-Life-2-da-Fullest5c48d629aafcb',26,'Live Life 2 da Fullest','<p>This is where you can express how life is in real time. We encourage you to share the positives so you are empowering others.</p>\r\n','https://cjclive.com/uploads/channels/picture/2bf4cd3cc6fc44b761813353c1e7a18289da125b.JPG','https://cjclive.com/uploads/channels/cover/e8193d679b76553a1a1a591fbb6a895120385c09.jpg',1,1,'2019-01-23 21:01:29','2019-01-23 21:01:29',1),(12,'Wassup-Mama-Cyn-5c48dcbfeb075',17,'Wassup Mama Cyn ','<p>This is where we can share ourselves in a positive way.</p>\r\n','https://cjclive.com/uploads/channels/picture/89368685633f60d24aee2b655b5a6cadb69e8e5c.jpg','https://cjclive.com/uploads/channels/cover/63b7f48b3aef39cfd246318ec335146ff59be1b8.jpg',1,1,'2019-01-23 21:29:35','2019-01-23 21:29:35',1),(13,'Boyz,-Carz-and-Hobby5c48e1800d325',29,'Boyz, Carz and Hobby','<p>Let&#39;s show How to have Fun</p>\r\n','https://cjclive.com/uploads/channels/picture/000faec3598deaf55c9d7faa529218299c3d5be2.jpg','https://cjclive.com/uploads/channels/cover/f71f19431f8460cbdb68b4f92750c55ebe4f1f5d.JPG',1,1,'2019-01-23 21:49:52','2019-01-23 21:49:52',1),(14,'My--Worldly-Adventures5c48e3f35924e',30,'My  Worldly Adventures','<p>A place where I can share my travels, my daily routine, my favorite things to do and my worldly adventures.</p>\r\n','https://cjclive.com/uploads/channels/picture/ef14b678f83c0aa63463510e2308f5e2266b291f.JPG','https://cjclive.com/uploads/channels/cover/0f5be8ccd64f4222e0a36032b54f12deadea68c3.jpg',1,1,'2019-01-23 22:00:19','2019-01-23 22:00:19',1),(15,'Self-Empowerment5c48eabc43bb1',31,'Self Empowerment','<p>A place where you can workout with others or at the comfort of your home;&nbsp;&nbsp;improve your yourself at your own time.</p>\r\n','https://cjclive.com/uploads/channels/picture/ffdf2a213ae86a310aa1a80e836582bce5542e9e.jpg','https://cjclive.com/uploads/channels/cover/4ad3dc89d0f3bbc5965ae701205400ee23a98f9d.jpg',1,1,'2019-01-23 22:22:07','2019-01-23 22:29:16',1),(16,'BITCOIN-NINJA-TRAINING-5c4ad9b66c31c',35,'BITCOIN NINJA TRAINING ','<p>Ninjutsu, sometimes used interchangeably with the modern term ninpō, is the strategy and tactics of unconventional warfare, guerrilla warfare and espionage purportedly practiced by the ninja.</p>\r\n\r\n<p>Bitcoin is a cryptocurrency, a form of electronic cash. It is a decentralized digital currency without a central bank or single administrator that can be sent from user-to-user on the peer-to-peer bitcoin network without the need for intermediaries.</p>\r\n','https://cjclive.com/uploads/channels/picture/c91667ede971f1be6f541d47809f56fb85369f50.JPG','https://cjclive.com/uploads/channels/cover/3c79057b703ed6a8cc748e0e2e619834495ecf02.jpg',1,1,'2019-01-24 01:43:55','2019-01-25 09:41:10',1),(17,'Lost-and-My-adventures-circa-20185c491a36d76bf',36,'Lost and My adventures circa 2018','<p>Follow us on as we go through life&#39;s adventures,&nbsp;and living&nbsp;the meaning of &quot;soulmate&quot;, creating memories.</p>\r\n','https://cjclive.com/uploads/channels/picture/5d9c66391b6d37e0b342ef3671864711b73014f9.JPG','https://cjclive.com/uploads/channels/cover/41c5f17c2b42e47999121c1efad4649a870b33cc.JPG',1,1,'2019-01-24 01:51:50','2019-01-24 01:51:50',1),(19,'San-Antonio-Events5c495bcf966b1',24,'San Antonio Events','<p>Fun Events for Singles, Couples and Family!!!</p>\r\n','https://www.cjclive.com/uploads/channels/picture/57a3c3daf3e1383650df7fc7239cae5e45e83f3a.jpg','https://www.cjclive.com/uploads/channels/cover/99e955cbb6e5f03b12b29b298e779a29a7ecd177.jpg',1,1,'2019-01-24 06:31:43','2019-01-24 06:31:43',1),(20,'Industrial-grade-decentralized-platform5c4974e2ba227',38,'Industrial-grade decentralized platform','<h2 style=\"font-style:italic\"><strong>Decentralized Autonomous Cooperation (DAC)</strong></h2>\r\n\r\n<hr />\r\n<h2 style=\"font-style:italic\"><strong>BitShares Blockchain implements an industrial-grade technology focused on businesses, organizations or individuals, with an amazing eco-system and free-market economy. Based on open-source MIT-licensed Graphene technology, BitShares was launched in its existing form on 13th October 2015, known prior to that as a community project: &#39;ProtoShares&#39;. Ever since then, the BitShares blockchain and its dApps have been maintained and developed by workers elected via stakeholder consensus, consisting of more than 30 highly skilled professionals.</strong></h2>\r\n','https://cjclive.com/uploads/channels/picture/5689c913fdf79110fdb7148d4970b92b4f357738.jpg','https://cjclive.com/uploads/channels/cover/ce1fa5cd60bd20563db8bcb401fbaf2999724b01.png',1,1,'2019-01-24 08:12:31','2019-01-24 08:18:42',1),(21,'Industrial-grade-decentralized-platform5c4973729844d',38,'Industrial-grade decentralized platform','<h2 style=\"font-style:normal\">Decentralized Autonomous Cooperation (DAC)</h2>\r\n\r\n<hr />\r\n<p>BitShares Blockchain implements an industrial-grade technology focused on businesses, organizations or individuals, with an amazing eco-system and free-market economy. Based on open-source MIT-licensed Graphene technology, BitShares was launched in its existing form on 13th October 2015, known prior to that as a community project: &#39;ProtoShares&#39;. Ever since then, the BitShares blockchain and its dApps have been maintained and developed by workers elected via stakeholder consensus, consisting of more than 30 highly skilled professionals.</p>\r\n','https://cjclive.com/uploads/channels/picture/923013e98e375cc0d78c452a6ed9dbc406bd4a8d.jpg','https://cjclive.com/uploads/channels/cover/7fa3757bacc0b8a82cd3830a0da15f61d7d8fa41.png',1,1,'2019-01-24 08:12:34','2019-01-24 08:12:34',1),(22,'Industrial-grade-decentralized-platform5c4973797e2db',38,'Industrial-grade decentralized platform','<h2 style=\"font-style:normal\">Decentralized Autonomous Cooperation (DAC)</h2>\r\n\r\n<hr />\r\n<p>BitShares Blockchain implements an industrial-grade technology focused on businesses, organizations or individuals, with an amazing eco-system and free-market economy. Based on open-source MIT-licensed Graphene technology, BitShares was launched in its existing form on 13th October 2015, known prior to that as a community project: &#39;ProtoShares&#39;. Ever since then, the BitShares blockchain and its dApps have been maintained and developed by workers elected via stakeholder consensus, consisting of more than 30 highly skilled professionals.</p>\r\n','https://cjclive.com/uploads/channels/picture/fbe591deca0c3281196b5d79ab539203556e476d.jpg','https://cjclive.com/uploads/channels/cover/42a1d4ad16d080f741ffe30ba7af5e276fa69fdf.png',1,1,'2019-01-24 08:12:41','2019-01-24 08:12:41',1),(23,'Music-World5c497898ad9c8',39,'Music World','<p>Music World</p>\r\n','https://www.cjclive.com/uploads/channels/picture/2292e81655b060278d2b9c74bc6755e18a341051.jpg','https://www.cjclive.com/uploads/channels/cover/a3c0c5a3ce21b5a5aa59bc338f819115b82db015.jpg',1,1,'2019-01-24 08:34:32','2019-01-24 08:34:32',1),(24,'The-Growth-of-a-Empire-5c497b86a39ad',40,'The Growth of a Empire ','<p>Evolving Connections and Randomness&nbsp;</p>\r\n','https://www.cjclive.com/uploa