K GLOBALLY','','1',NULL,799.00,0,0,'2019-01-24 20:20:52','2019-02-20 01:25:21',0.00),(11,'Mobile-Advertising5c4a1ed88491d5c67bc5681afb','Mobile Advertising','Companies looking to target potential customers through the exploding reach of mobile devices turn to CJCLIVE . We offer a range of reach, targeting and results through all forms of mobile advertising: search, display, in app, maps, directory, social and video.\r\n\r\n','','1',NULL,399.00,0,0,'2019-01-24 20:23:52','2019-02-20 01:25:05',0.00),(12,'Intentional-Direct-Mail5c4a1f4c80d2e5cc2b7ed6c8f75cc2b875255015cc2b8f2254805cc2b94e4704e5cc2b99ed118d5cc67e1d0956c','Intentional Direct Mail','<p>Intentional Direct Mail technology targets previously unknown website visitors who&rsquo;ve demonstrated interest in a business. A custom direct mail postcard will be delivered to their potential customers&rsquo; home within days of their website visit.</p>\r\n','','1',NULL,499.00,0,0,'2019-01-24 20:25:48','2019-04-28 23:01:25',1.00);
