ng','https://cjclive.com/uploads/videos/bfc1a05ad63696d8961d28244d37809d30767044.mp4','','0','00:00:37','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,196,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x240bfc1a05ad63696d8961d28244d37809d30767044.mp4,https://www.cjclive.com/uploads/videos/640x360bfc1a05ad63696d8961d28244d37809d30767044.mp4,https://www.cjclive.com/uploads/videos/854x480bfc1a05ad63696d8961d28244d37809d30767044.mp4,https://www.cjclive.com/uploads/videos/1280x720bfc1a05ad63696d8961d28244d37809d30767044.mp4','426x240,640x360,854x480,1280x720','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-01-24 08:00:43','2019-04-12 01:32:20',35,'user',5,'Technology ','','',0,0,NULL),(26,23,'Musical-World5c497c256bc0c','Musical World','<p>Musical World</p>\r\n','https://www.cjclive.com/uploads/images/23_1548319781_001.png','https://www.cjclive.com/uploads/videos/4fb2acbf21657be663e1bee336dfddf15eb793a1.mp4','','0','00:04:11','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,164,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x2404fb2acbf21657be663e1bee336dfddf15eb793a1.mp4','426x240','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-01-24 08:49:43','2019-06-06 00:55:57',39,'user',4,'Motivation','','',0,0,NULL),(27,24,'That-Start-5c497c7970dde','Internets Own Boy ','<p>A Must see film.</p>\r\n','https://www.cjclive.com/uploads/images/24_1548319865_001.png','https://www.cjclive.com/uploads/videos/ffdb12266b7b4d529965f1484f64d37823314118.mp4','','0','00:02:10','1','0000-00-00 00:00:00',1,1,1,0,NULL,5600.00,291,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x240ffdb12266b7b4d529965f1484f64d37823314118.mp4,https://www.cjclive.com/uploads/videos/640x360ffdb12266b7b4d529965f1484f64d37823314118.mp4,https://www.cjclive.com/uploads/videos/854x480ffdb12266b7b4d529965f1484f64d37823314118.mp4','426x240,640x360,854x480','1',1,1,0,0,0,0,0.00,0.00,0.00,NULL,'2019-01-24 08:51:08','2019-06-05 23:51:07',40,'user',5,'Technology ','','',0,0,NULL),(28,16,'CYLANCE5c4adb980be22','CYLANCE','<p>&nbsp;</p>\r\n\r\n<h2 style=\"font-style:italic\"><br />\r\nBest Security Technology&nbsp;</h2>\r\n','https://cjclive.com/uploads/images/16_1548409752_003.png','https://cjclive.com/uploads/videos/cfe79ac795727c0bb2f47fc5a800066fb858bce8.mp4','','0','00:02:36','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,116,0,0,NULL,NULL,NULL,'1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-01-25 09:49:13','2019-04-11 21:31:25',35,'user',5,'Technology ','','',0,0,NULL),(29,31,'Jowee-Clips5c6112e23e688','Jowee Clips','<p>Dear Jowee,</p>\r\n\r\n<p>What&#39;s your secret to having such a great life and looking so hot?</p>\r\n\r\n<p>Molly</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dear Molly,</p>\r\n\r\n<p>I ooze love, baby. People can&#39;t resist me and the babes can&#39;t get enough of me. Pick your family wisely. You want people who love you unconditionally and are willing to do some serious pampering. But that&#39;s what I give right back. And you gotta do the cardio to get this bod.</p>\r\n\r\n<p>Love, Jowee</p>\r\n','https://cjclive.com/uploads/images/31_1549865698_002.png','https://cjclive.com/uploads/videos/dc25e004c6b2b0bb3a024eb0b66676aa7ceaf450.mp4','','0','00:00:09','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,87,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x240dc25e004c6b2b0bb3a024eb0b66676aa7ceaf450.mp4,https://www.cjclive.com/uploads/videos/640x360dc25e004c6b2b0bb3a024eb0b66676aa7ceaf450.mp4,https://www.cjclive.com/uploads/videos/854x480dc25e004c6b2b0bb3a024eb0b66676aa7ceaf450.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-11 06:14:58','2019-04-08 10:28:18',18,'user',4,'Motivation','','',0,0,NULL),(30,31,'Jowee-at-the-Hospitla---Day-15c6114f1e20b8','Jowee at the Hospitla - Day 1','<p>Life is testing me. My legs started to weaken and mom had to take me to the vet clinic. By the next day I was paralyzed from the shoulders down. All I can do is lie there whiile the doctor pokes me and runs test after test. I&#39;m in pain and drowsy from the medication. My family visits me but I&#39;m scared! Please pray for me!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','https://cjclive.com/uploads/images/31_1549866225_001.png','https://cjclive.com/uploads/videos/2266eca02b949b2e00834dbee047e5162a304de4.mp4','','0','00:00:38','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,89,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x2402266eca02b949b2e00834dbee047e5162a304de4.mp4,https://www.cjclive.com/uploads/videos/640x3602266eca02b949b2e00834dbee047e5162a304de4.mp4,https://www.cjclive.com/uploads/videos/854x4802266eca02b949b2e00834dbee047e5162a304de4.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-11 06:23:48','2019-04-12 04:48:23',18,'user',4,'Motivation','','',0,0,NULL),(31,31,'Jowee-at-the-Hospital---Day-25c6119766fffa','Jowee at the Hospital - Day 2','<p>Day 2 at the hospital - I&#39;m feeling a little better today. I still can&#39;t stand or walk but I&#39;m able to move my legs a little and my tail works fine. Why is this happening to me? I&#39;m overjoyed to see my family and tell them what I&#39;m going through.&nbsp;</p>\r\n\r\n<p>What I know for sure:&nbsp;My family loves me so much and love is the best medicine.</p>\r\n','https://cjclive.com/uploads/images/31_1549867382_001.png','https://cjclive.com/uploads/videos/dd7c25dbeeb66a878669943d1d50979de40488d0.mp4','','0','00:00:32','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,63,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x240dd7c25dbeeb66a878669943d1d50979de40488d0.mp4,https://www.cjclive.com/uploads/videos/640x360dd7c25dbeeb66a878669943d1d50979de40488d0.mp4,https://www.cjclive.com/uploads/videos/854x480dd7c25dbeeb66a878669943d1d50979de40488d0.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-11 06:43:04','2019-04-11 18:44:50',18,'user',4,'Motivation','','',0,0,NULL),(32,31,'Jowee-at-the-Hospital---Day-2-with-Mom5c611cf3c1f23','Jowee at the Hospital - Day 2 with Mom','<p>Day 2 at the hospital: It really helps to talk to mom. When she come to visit me I tell her everything I&#39;m feeling and don&#39;t hold back. It hurts, I&#39;m scared, I don&#39;t understand why this is happening, and I want to go home!</p>\r\n\r\n<p>What I know for sure: When you are going through a tough time you can&#39;t go it alone. It&#39;s important to lean on your loved ones and let them help you through it. Our love for each other gives me great strength and courage.</p>\r\n','https://cjclive.com/uploads/images/31_1549868275_001.png','https://cjclive.com/uploads/videos/06c16ebd76f746c47dd2d2e6d7afd2bc4c641b49.mp4','','0','00:01:04','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,61,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x24006c16ebd76f746c47dd2d2e6d7afd2bc4c641b49.mp4,https://www.cjclive.com/uploads/videos/640x36006c16ebd76f746c47dd2d2e6d7afd2bc4c641b49.mp4,https://www.cjclive.com/uploads/videos/854x48006c16ebd76f746c47dd2d2e6d7afd2bc4c641b49.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-11 06:57:59','2019-04-11 03:31:17',18,'user',4,'Motivation','','',0,0,NULL),(33,31,'Day-3-Jowee-at-the-Hospital5c74602e14bb9','Day 3 Jowee at the Hospital','<p>Well, Dad came to visit me today and started talking about going to the park and doing all the fun things I love to do like hunting for mongoose and playing squeaky toy fetch games. I miss doing it so much it hurts! But it makes me want to fight so hard to get better. I&#39;m getting a little stronger today.</p>\r\n\r\n<p>What I know for sure: If you have a strong reason to fight your way back up, you can move mountains! I love life and I wanna fight with all my might!</p>\r\n','https://www.cjclive.com/uploads/images/31_1551130670_001.png','https://www.cjclive.com/uploads/videos/77e3f64ebcdd7479fe05a7e50e22ddc710bf88e5.mp4','','0','00:00:15','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,113,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x24077e3f64ebcdd7479fe05a7e50e22ddc710bf88e5.mp4,https://www.cjclive.com/uploads/videos/640x36077e3f64ebcdd7479fe05a7e50e22ddc710bf88e5.mp4,https://www.cjclive.com/uploads/videos/854x48077e3f64ebcdd7479fe05a7e50e22ddc710bf88e5.mp4','426x240,640x360,854x480','1',1,1,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-11 07:02:52','2019-04-11 01:09:08',18,'user',4,'Motivation','','',0,0,NULL),(34,31,'Jowee-Going-on-a-Mongoose-Hunt5c6120becea90','Jowee Going on a Mongoose Hunt','<p>Mongoose hunting is the bomb! They like to hide in the bushes. First, listen for the sound of rustling and squealing. Then poke your nose in the bushes and sniff them out. I don&#39;t hurt them. I just like to bark and argue with them. Feisty little critters!</p>\r\n\r\n<p>What I know for sure: When you are pursuing a goal, don&#39;t make a lot of noise and chase after it like Mister Big Stuff. Tread quietly and carefully and let them lead you to them. And enjoy the game!</p>\r\n','https://cjclive.com/uploads/images/31_1549869246_003.png','https://cjclive.com/uploads/videos/09f9722abb07181f5202270944b5bd9784ed95f8.mp4','','0','00:00:09','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,116,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x24009f9722abb07181f5202270944b5bd9784ed95f8.mp4,https://www.cjclive.com/uploads/videos/640x36009f9722abb07181f5202270944b5bd9784ed95f8.mp4,https://www.cjclive.com/uploads/videos/854x48009f9722abb07181f5202270944b5bd9784ed95f8.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-11 07:14:07','2019-04-12 00:03:38',18,'user',2,'General','','',0,0,NULL),(35,26,'Test-Video5c61e06b0bbc0','Test Video','<p>Test Video</p>\r\n','https://cjclive.com/uploads/images/26_1549918315_001.png','https://cjclive.com/uploads/videos/f93d205122d81de809153723ac415c6d80dcbfe4.mp4','','0','00:00:11','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,164,0,0,NULL,NULL,NULL,'1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-11 20:51:55','2019-06-11 04:09:09',41,'user',3,'Travel','','',0,0,NULL),(36,31,'Day-45c64c3beeef40','Day 4','<p>This is Day 4 on Jowee&#39;s healing journey. Starting physical therapy, bicycle legs, short standing with assistance. He is making some improvements but is very tired.</p>\r\n\r\n<p>What I know for sure: I trust that I am loved and being helped. Surrender and keep fighting. Mom says many people are praying for me and the doctors and techs give me lots of care and attention.</p>\r\n','https://cjclive.com/uploads/images/31_1550107583_002.png','https://cjclive.com/uploads/videos/1b66ec8b6838eb2c47eb826624f210da07914680.mp4','','0','00:00:39','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,47,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x2401b66ec8b6838eb2c47eb826624f210da07914680.mp4,https://www.cjclive.com/uploads/videos/640x3601b66ec8b6838eb2c47eb826624f210da07914680.mp4,https://www.cjclive.com/uploads/videos/854x4801b66ec8b6838eb2c47eb826624f210da07914680.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-14 01:26:25','2019-04-09 06:52:55',18,'user',4,'Motivation','','',0,0,NULL),(37,31,'Day-55c64c6516b548','Day 5','<p>Day 5 on my healing journey. I&#39;m able to move my legs a little more. The doctor took my catheter out and I can pee on my own now. Mom says I can come home tomorrow!</p>\r\n\r\n<p>What I know for sure: When mom said she is bringing me home, and she wants to take me to the park, I felt so happy! I&#39;m going to fight so hard for my good life!</p>\r\n','https://cjclive.com/uploads/images/31_1550108241_001.png','https://cjclive.com/uploads/videos/f994a36fa4a805bb533624ac8e4ebd4a9b917387.mp4','','0','00:00:51','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,61,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x240f994a36fa4a805bb533624ac8e4ebd4a9b917387.mp4,https://www.cjclive.com/uploads/videos/640x360f994a36fa4a805bb533624ac8e4ebd4a9b917387.mp4,https://www.cjclive.com/uploads/videos/854x480f994a36fa4a805bb533624ac8e4ebd4a9b917387.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-14 01:37:23','2019-04-11 18:41:29',18,'user',4,'Motivation','','',0,0,NULL),(38,31,'Home-Day-65c64c7f62502f','Home Day 6','<p>Home Day 6: Mom and Dad took me home today! I am so happy I can&#39;t stop yapping my joy in the car. Dad had this great idea to help me with physical therapy so they rigged a home-made cart to help me practice walking. It&#39;s hard work and I got very tired but I can feel my legs getting stronger!</p>\r\n\r\n<p>What I know for sure: If you really want something and you pour your heart and soul into it, you can move mountains!</p>\r\n','https://cjclive.com/uploads/images/31_1550108662_001.png','https://cjclive.com/uploads/videos/fdc719ccbda351d8787af3f14afa2e87e88d9023.mp4','','0','00:00:18','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,108,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x240fdc719ccbda351d8787af3f14afa2e87e88d9023.mp4,https://www.cjclive.com/uploads/videos/640x360fdc719ccbda351d8787af3f14afa2e87e88d9023.mp4,https://www.cjclive.com/uploads/videos/854x480fdc719ccbda351d8787af3f14afa2e87e88d9023.mp4','426x240,640x360,854x480','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-02-14 01:44:23','2019-04-11 19:32:50',18,'user',4,'Motivation','','',0,0,NULL),(39,31,'Home-Day-75c65ef1853f0c','Home Day 7','<p>Day 7: I&#39;m home! I slept with mom last night and ate a delicious dinner, such a treat after all that boring hospital food. My family helped me with physical therapy again. My new walker needs some improving but it helps a lot. I can feel my legs getting stronger. I feel so happy and alive. I&#39;m know I&#39;m going to recover! I can do it!</p>\r\n\r\n<p>What I know for sure: You can do anything if you believe you can and want it with your whole heart and soul!</p>\r\n','https://cjclive.com/uploads/images/31_1550184216_001.png','https://cjclive.com/uploads/videos/bda19d40bb2393532c5814a81ab94fa4424f6c2f.mp4','','0','00:00:48','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,157,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x240bda19d40bb2393532c5814a81ab94fa4424f6c2f.mp4,https://www.cjclive.