>About Women&#39;s History Month<br />\r\nWomen&rsquo;s History Month had its origins as a national celebration in 1981 when Congress passed Pub. L. 97-28 which authorized and requested the President to proclaim the week beginning March 7, 1982 as &ldquo;Women&rsquo;s History Week.&rdquo; Throughout the next five years, Congress continued to pass joint resolutions designating a week in March as &ldquo;Women&rsquo;s History Week.&rdquo; In 1987 after being petitioned by the National Women&rsquo;s History Project, Congress passed Pub. L. 100-9 which designated the month of March 1987 as &ldquo;Women&rsquo;s History Month.&rdquo; Between 1988 and 1994, Congress passed additional resolutions requesting and authorizing the President to proclaim March of each year as Women&rsquo;s History Month. Since 1995, Presidents Clinton, Bush and Obama have issued a series of annual proclamations designating the month of March as &ldquo;Women&rsquo;s History Month.&rdquo;</p>\r\n','https://www.cjclive.com/uploads/images/83_1553709845_003.png','https://www.cjclive.com/uploads/videos/1b3bf6db62340a4959de28c5ee89c00d4cb16eea.mp4','','0','00:00:19','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,74,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x2401b3bf6db62340a4959de28c5ee89c00d4cb16eea.mp4,https://www.cjclive.com/uploads/videos/640x3601b3bf6db62340a4959de28c5ee89c00d4cb16eea.mp4,https://www.cjclive.com/uploads/videos/854x4801b3bf6db62340a4959de28c5ee89c00d4cb16eea.mp4,https://www.cjclive.com/uploads/videos/1280x7201b3bf6db62340a4959de28c5ee89c00d4cb16eea.mp4','426x240,640x360,854x480,1280x720','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-03-27 18:04:07','2019-04-10 18:15:47',212,'user',4,'Motivation','','',0,0,NULL),(330,39,'Stop-Saying-\"I-Love-You\"-5c9bed11b53be','Stop Saying \"I Love You\" ','<p>Stop Saying &quot;I Love You&quot; If You don&#39;t know the real meaning. The video that&nbsp;everyone needs to see and understand</p>\r\n\r\n<p>Credits: Change For Balance&nbsp;</p>\r\n',