cessful-Habits-to-have-a-Billionaire-Mindset-from-Health-to-Wealth5ca224411be1f','Successful Habits to have a Billionaire Mindset from Health to Wealth','<p>Speaker : Jim Kwik</p>\r\n\r\n<p>1. Good brain food.<br />\r\n2. Kill negative thoughts and do self talk.<br />\r\n3. Exercise.<br />\r\n4. Brain nutrients.<br />\r\n5. Positive peer group.<br />\r\n6. Clean environment.<br />\r\n7. Sleep.<br />\r\n8. Protect your brain from radiations (mobiles).<br />\r\n9. Learning.<br />\r\n10. Stress management.﻿</p>\r\n','https://cjclive.com/uploads/images/42_1554130319_001.png','https://cjclive.com/uploads/videos/65885c7fc711f987290480d12809b95cf00a0bd1.mp4','','0','00:07:40','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,34,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x24065885c7fc711f987290480d12809b95cf00a0bd1.mp4,https://www.cjclive.com/uploads/videos/640x36065885c7fc711f987290480d12809b95cf00a0bd1.mp4,https://www.cjclive.com/uploads/videos/854x48065885c7fc711f987290480d12809b95cf00a0bd1.mp4,https://www.cjclive.com/uploads/videos/1280x72065885c7fc711f987290480d12809b95cf00a0bd1.mp4','426x240,640x360,854x480,1280x720','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-04-01 14:52:48','2019-04-11 08:36:11',41,'user',4,'Motivation','','',0,0,NULL),(374,79,'Scummy-Unplugged-Exclusive-Interview-with-Ryan-Hughes,-Motocross-Savage5ca26ebf5587e','Scummy Unplugged Exclusive Interview with Ryan Hughes, Motocross Savage','<p><a href=\"http://RecoveryTodayMagazine.com\" target=\"_blank\"><strong>http://RecoveryTodayMagazine.com&nbsp;</strong></a><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>If you or anyone you know, needs addiction recovery help. Call Now 24/7 Recovery Support <a href=\"tel:800-595-3803\">800-595-3803</a></strong></p>\r\n\r\n<p><strong><img alt=\"\" src=\"https://photos.smugmug.com/Clients-/Ryan-Hughes/n-KP5Nwz/i-Kz858Hm/0/1c96e23d/X3/i-Kz858Hm-X3.jpg\" style=\"height:300px; width:200px\" /></strong></p>\r\n\r\n<p>Scummy Unplugged Exclusive Interview with Ryan Hughes, Motocross Savage It sounds kind of stupid to say &ldquo;I love motocross&rdquo; because if you&rsquo;ve read anything I&rsquo;ve written, done videos for or posted on social media for many years, besides sobriety and my family (OK, maybe guns, cool underwear and Keybar), it&rsquo;s all about Motocross.</p>\r\n\r\n<p>In the world of professional sports, often your enthusiasm goes away after you&rsquo;ve done it for a long time but not with me and not with motocross. &nbsp;Since I was a kid and first infected with the motocross bug, for lack of a better word, &ldquo;I&rsquo;ve been addicted it&rdquo;. It&rsquo;s in my blood and it always will be. &nbsp;Now, instead of competing, I give lessons to people about Freestyle and jumping and I run a bad ass motocross team. The guy I&rsquo;m interviewed for this month&rsquo;s issue of Scummy Unplugged is a legend.</p>\r\n\r\n<p>If you&rsquo;re not into motocross, but you like football, I&rsquo;ll say it this way, he&rsquo;d be Marshawn Lynch because he was pure Beast-Mode! &nbsp;He&rsquo;s an absolute stud, a phenomenal human being and he also happens to be very, very serious about sobriety.</p>\r\n\r\n<p>To say I was psyched to do this interview is an understatement.</p>\r\n\r\n<p><strong>This month, I bring you my exclusive interview with Ryan Hughes. </strong></p>\r\n\r\n<p>Ryan was an absolute savage when he raced and I gotta say, just seeing him on the track before the race struck fear into everyone. &nbsp;He had this &ldquo;take no prisoners&rdquo; kind of attitude to get to the front when he raced. Nothing stopped him, it was like he hit a switch when he raced and all he saw was the finish line, not to be stopped by anything or anyone. He consistently left it all out there. All he had, is all he gave, every single time. He didn&rsquo;t win them all but no one there ever questioned why they called Ryan, &ldquo;Ryno&rdquo; because it might have been better if you faced a charging Rino this this guy.</p>\r\n\r\n<p>Now that he&rsquo;s done racing, he brings his Ryno attitude into everything else he does including his sobriety. He&rsquo;s created several very successful business doing everything from fitness coaching, to equipment and sports supplements. The guy is a savage at life itself.</p>\r\n\r\n<p>He first emerged on the professional circuit in the early 90s and was part of the legendary Spitfire Kawasaki team and gained both fame and respect in the final round of the 125 championship when his chain broke right at the finish line and he pushed his bike uphill to finish.</p>\r\n\r\n<p>Later he rode for some of the highest-profile teams, including Honda and Kawasaki factory teams and in 1999 moved to Europe where he took fourth in the championship standings with Pamo Honda and was instrumental in US claiming the Motocross of Nations&rdquo; title.</p>\r\n\r\n<p><br />\r\nLater, he got a dream gig, riding million dollar bikes as a test pilot for Honda, and catapulted his way back to the pinnacle of American Motocross but as happens in motocross, injuries and concussions at the end of the season forced him into his first retirement.&nbsp;</p>\r\n\r\n<p><br />\r\nTwo years later, he was back on the scene with another set of runs at the 125 Outdoor National Championship and came close to winning the title two different times, competing with a broken foot and might have won except the last race of the series was cancelled so he finished the season 7 points behind.</p>\r\n\r\n<p><br />\r\nNeedless to say, the guy is tough as nails, incredibly respected in our sport and by everyone who know him. &nbsp;When I think of what makes a great human being, a guy who who&rsquo;s battled it all including addiction, he&rsquo;s one of the first I think of.</p>\r\n\r\n<p>You&rsquo;ll love the interview.</p>\r\n\r\n<p>See this interview and all exclusive interviews and more at:<br />\r\n<a href=\"http://RecoveryTodayMagazine.com\"><strong>http://RecoveryTodayMagazine.com</strong></a></p>\r\n\r\n<p>The #1 Addiction, Sobriety and Recovery Magazine in the World and its 100% FREE. Download Now. Its perfectly Optimized for your Mobile Device.</p>\r\n\r\n<p><strong>For 24 / 7 Addiction Help, call <a href=\"tel:800-595-3803\">800-595-3803</a></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>#rinopower #ryanhughes, #collinmorrison #scummy #fmx #motocross #metalmulisha #skvi #RecoveryTodayMagazine #RecoveryToday #HeroinAddiction #RecoveryHope #RecoveryInspiration #RecoveryMagazine #wedorecovery #recoverycoach #sober #sobercoach #TherapistAdvertising #AddictionMagazine #SobreityMagazine #heroinaddictionhelp #alcoholismhelp #alcoholism #alcohol #heroin #fuckheroin #depression #detox #sobriety #12steps #soberisexy #recoveryroad #keybar #drugrehab #addictiontherapist #treatmentcenter #opiatedetox #cbd #sobarecovery #greghannley #magazine #digitalmagazine #diyopiatedetox #opiatehomedetox #naturalopiatedetox #drugaddictionrehab #drugaddictionclinic #drugaddictioncenters #mentalhealth #hope #Sobamalibu, #malibufilms, #SobrietyMagazine #RecoveryHelp #DrugRehab #OpiateCrisis #OpiateDetoxFromHome &nbsp;#SoberisSexy #12Step #PartySober #AlcoholismHelp #FreeRecoveryhelp<br />\r\n&nbsp;</p>\r\n','https://www.cjclive.com/uploads/images/79_1554152975_001.png','https://www.cjclive.com/uploads/videos/9f440dc32c70489fc68916924c5c52ee017e35ac.mp4','','0','01:29:54','1','0000-00-00 00:00:00',1,1,1,0,NULL,0.00,28,0,0,NULL,'https://www.cjclive.com/uploads/videos/426x2409f440dc32c70489fc68916924c5c52ee017e35ac.mp4,https://www.cjclive.com/uploads/videos/640x3609f440dc32c70489fc68916924c5c52ee017e35ac.mp4,https://www.cjclive.com/uploads/videos/854x4809f440dc32c70489fc68916924c5c52ee017e35ac.mp4,https://www.cjclive.com/uploads/videos/1280x7209f440dc32c70489fc68916924c5c52ee017e35ac.mp4','426x240,640x360,854x480,1280x720','1',1,0,0,0,0,0,0.00,0.00,0.00,NULL,'2019-04-01 21:19:01','2019-04-10 10:21:48',461,'user',2,'General','','',0,0,NULL),(375,147,'FLAME-ON\'5ca2d9f685622','FLAME ON\'','<